CREATE VIEW [dbo].[vRemarks]
AS
SELECT * from (
SELECT ID_Remark,CE_ID_Project,Remark,LastModifyDate, ROW_NUMBER() OVER (PARTITION BY CE_ID_Project ORDER BY LastModifyDate DESC) SEQ FROM ProjectsRemarks 
) SUB WHERE SUB.SEQ=1
