INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1844, 68, N'ESB\SCG', CAST(N'2020-01-30T07:39:45.000' AS DateTime), N'old deadline <31.12.2019> new deadline <31.03.2020> ; old Text_IT_Board <> new Text_IT_Board <L’enregistreur ASC EVOIP a été mis en service comme prévu le 17 décembre 2019. Pour des 
questions de protection des données, le système a été arrêté en attendant de régulariser la 
situation du point de vue juridique. 
Nouveau délai : 31 mars 2020 > ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1845, 90, N'ESB\SCG', CAST(N'2020-01-30T07:40:20.000' AS DateTime), N'old deadline <31.12.2019> new deadline <31.03.2020> ; old Text_IT_Board <> new Text_IT_Board <? Le système de stockage HPE Nimble a été livré le 29.10.2019 et mise en service le 22 novembre 
2019. 
? La 2e Nimble a été mise en service au Data.Hub le jeudi 5 décembre 2019. 
? Les backups se font sur la Nimble depuis le week-end du 23 novembre 2019. 
? Toutes les VM’s de production ont été déplacées sur la Nimble. 
? Certaines anciennes VM’s (SAP) qui ne sont plus en service sont encore sur la 3PAR et ne seront 
pas déplacées mais effacées. Ce sera durant les mois de février et mars. 
Nouveau délai : 31 mars 2020> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1846, 91, N'ESB\SCG', CAST(N'2020-01-30T07:40:53.000' AS DateTime), N'old deadline <31.12.2019> new deadline <31.03.2020> ; old Text_IT_Board <> new Text_IT_Board <? Le serveur NMC (Envinet) est installé, les règles de firewall et les VLAN définis. 
? La mémoire supplémentaire est installée dans les serveurs ESXi. 
? La partie IT est terminée, il ne reste qu’à mettre la sonde en place et à tester les 
communications. 
Nouveau délai : 31 mars 2020 (en attente de la confirmation de la direction de projet) > ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1847, 94, N'ESB\SCG', CAST(N'2020-01-30T07:41:16.000' AS DateTime), N'old deadline <01.01.2020> new deadline <29.02.2020> ; old Text_IT_Board <> new Text_IT_Board <Les travaux sont terminés pour la partie IT. L’IT et la logistique attendent l’entrée marchandise lors 
de la 1ère livraison afin de faire ensemble les opérations dans SAP pour contrôle si tout est OK. 
Nouveau délai : 29 février 2020 (en attente de la confirmation de la logistique)> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1848, 95, N'ESB\SCG', CAST(N'2020-01-30T07:41:42.000' AS DateTime), N'old deadline <31.12.2019> new deadline <29.02.2020> ; old Text_IT_Board <> new Text_IT_Board <Les rapports sont en cours de réalisation. Quelques questions sont encore ouvertes et le délai a été 
discuté avec David Chaignat 
Nouveau délai : fin février 2020> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1849, 86, N'ESB\SCG', CAST(N'2020-01-30T07:42:03.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <Les 8 serveurs SAP seront migrés entre octobre 2019 et février 2020, la migration se déroule selon 
la planification. 
Les systèmes EP1 / EI1 / ET1 / PIT / PIP / WDP ont déjà été migrés. 
Les systèmes CM / SME seront migrés durant le mois de février.> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1850, 92, N'ESB\SCG', CAST(N'2020-01-30T07:42:18.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <Ce projet est la suite du concept SuperUser et l’intégration dans le document « Rollen und 
Verantwortlichkeiten für IT Ressourcen ». 
Ce point est à l’ordre du jour de la séance de l’IT-Board du 27 janvier 2020. > ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1851, 87, N'ESB\SCG', CAST(N'2020-01-30T07:42:29.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <Les ressources sont réservées chez Informatec pour février-mars. 
La définition du travail en interne (BRA) et en externe (Informatec) est en cours > ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1852, 4, N'ESB\SCG', CAST(N'2020-01-30T07:42:43.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <Le remplacement des notebooks est dépendant de la virtualisation des applications (Cobra, 
CareOffice, ZFA, etc.) 
Les notebooks sans ces applications ont été remplacés, les suivants seront remplacés dès que les 
applications seront migrées sur Windows 10. 
Quelques utilisateurs ont constaté de petits problèmes (double-écran, freeze du VDI) et nous 
sommes à la recherche des solutions.> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1853, 55, N'ESB\SCG', CAST(N'2020-01-30T07:43:05.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <La migration est en cours, à ce jour, plus de 100 utilisateurs sont déjà migrés en Windows 10. 
ZFA n’a pas encore été migrés en raison des problèmes en cours de résolution avec Optimatik. 
Kaba a été migré en semaine 4, PlanCal sera migré en février, Symfact en mars-avril, etc. > ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1854, 93, N'ESB\SCG', CAST(N'2020-01-30T07:43:15.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <Le Kick-Off IT a eu lieu et la suite et en cours de planification pour qu’on puisse débuter en début 
d’année 2020 comme prévu. 
Nous avons l’offre (2e offre corrigée) et nous avons passé commande> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1855, 38, N'ESB\SCG', CAST(N'2020-01-30T07:43:30.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <Il y a encore 27 serveurs en Windows 2008 R2, certains fonctionnent à double pour les postes 
clients qui ne sont pas encore à Windows 10. > ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1856, 75, N'ESB\SCG', CAST(N'2020-01-30T07:43:44.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <Les connexions techniques sont en place, les fonctionnalités compris dans Rel.1 et 2 sont 
actuellement mis en place. Premiers Workshops de test sont prévus pour KW6. > ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1857, 83, N'ESB\SCG', CAST(N'2020-01-30T07:43:54.000' AS DateTime), N'old Text_IT_Board <> new Text_IT_Board <BEWIDA a présentation Abacus, innosolv a présenté IS-E. 
