INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (1940, 96, N'ESB\SCG', CAST(N'2020-02-20T08:41:38.000' AS DateTime), N'old Text_IT_Board <Une MFP de test a été commandé et sera livrée / installée mi-février (dépendant du fournisseur). 
 La MFP de test sera installée au 2e étage dans le couloir devant le bureau IT.> new Text_IT_Board <Das Testgerät für die Pilotphase wurde am 20.02.2020 angeliefert.
Die Installation für das Testgerät wird am 27.02.2020 stattfinden.
Anschliessend kann das Gerät zum Testen freigegeben werden.
Parallel dazu wurde ein Printerkonzpet erstellt wo alle relevanten Punkte hinsichtliche unseres Printerparks dokumentiert sind.> ; ')
