INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (2157, 83, N'ESB\SCG', CAST(N'2020-04-20T07:48:59.000' AS DateTime), N'old Text_IT_Board <Die Präsentationen mit BEWIDA und innosolv konnten erfolgreich abgehalten werden.

Die Fachgruppenworkshops sind in vollem gange.
5 von 7 Workshops konnten abgehalten werden.

Die Feebacks der Teilnehmer sind durchängig Positiv> new Text_IT_Board <Alle Fachgruppenworkshops konnten erfolgreich durchgeführt werden
Referenzbesuch bei ewl Luzern war sehr interessant und vermittelte uns einen guten Eindruck über die bei ewl eingesetzte Abacus / IS-e Lösung.
Die Learnings aus den Workshops sowie den Referenz- Besuche / Referate wurden in die (Nutzwert) Analyse einbezogen.

Am letzten Review-Meeting mit AWK konnte die Nutzwertanalyse erstellt werden, Sie zeigt auf das die beiden Lösungen IS-e / Abacus und SAP S/4 HANA in etwa gleich auf sind.
Für die Entscheidungsfindung wird die Strategische Ausrichtung entscheidend sein 

Aktuell stehen am 28.04.2020 noch Referate durch die zwei SAP Integratoren Avectris und Neo an.
Die Learnings werden anschliessend noch in die Entscheidungsfindung einfliessen.
Die strategische Ausrichtung wird noch durch BIH erarbeitet.> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (2158, 93, N'ESB\SCG', CAST(N'2020-04-20T07:49:22.000' AS DateTime), N'old Text_IT_Board <Das Kick-Off konnte am 13.02.2020 durchgefürt werden.

Die Vorbereitungen auf Seite ESB sind erledigt.
Die Vorbereitungen auf Seite Adfinis sind erledigt

Installation / Kofiguration zusammen mit Adfinis am 24.02 sowie am 26.02.2020.
Voraussichtlich kann ab KW 10 mit der Testphase begonnen werden.> new Text_IT_Board <Installation gemäss Vorgaben (Projektantrag) konnten durch Adfini Sy Group erfolgreich umgesetzt werden.
Das IT Infrastruktur Team hat noch Abklärungen bzw. Feinjustagen hinsichtlich Integration in unser FileSystem zu machen.

Grundsätzlich ist das Projekt gemäss Projektplanung auf Kurs, kam aber durch Corona nun in Verzug und muss um einen Monat verschoben werden.
Nach der Freigabe durch die IT Infrastruktur kann mit dem effektiven Testing mit den Testequipen begonnen werden
Die Testequipen sind klar und konnten bereits angegangen werden.
Folgende Test-Teams sind angedacht:
Seewasserwerk-Projekt Team
Marketing (Martin Kamber, Serge Rau) für Ablösung Trello (Kanban-Board)
Davide Crotta (Engineering) für generelle Abläufe, Projektstrukturen, Filesharing.
> ; ')
INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (2159, 96, N'ESB\SCG', CAST(N'2020-04-20T07:49:48.000' AS DateTime), N'old Text_IT_Board <Das Testgerät für die Pilotphase wurde am 20.02.2020 angeliefert.
Die Installation für das Testgerät wird am 27.02.2020 stattfinden.
Anschliessend kann das Gerät zum Testen freigegeben werden.
Parallel dazu wurde ein Printerkonzpet erstellt wo alle relevanten Punkte hinsichtliche unseres Printerparks dokumentiert sind.> new Text_IT_Board <Interne (IT) Geräte Tests erfolgreich.
Quick Guide erstellt
Anleitung erstellt
Information an ESB Mitarbeiter per Intranet Newsletter erfolgt
Dokumente auf Intranet abgelegt
Projektverzögerung durch Corona, Einführung muss um einen Monat verschoben werden.
> ; ')
