INSERT [dbo].[ProjectsHistory] ([ID_History], [CE_ID_Project], [ModifyBy], [ModifyDate], [Modification]) VALUES (2233, 83, N'ESB\SCG', CAST(N'2020-05-13T09:15:27.000' AS DateTime), N'old Text_IT_Board <Alle Fachgruppenworkshops konnten erfolgreich durchgeführt werden
Referenzbesuch bei ewl Luzern war sehr interessant und vermittelte uns einen guten Eindruck über die bei ewl eingesetzte Abacus / IS-e Lösung.
Die Learnings aus den Workshops sowie den Referenz- Besuche / Referate wurden in die (Nutzwert) Analyse einbezogen.

Am letzten Review-Meeting mit AWK konnte die Nutzwertanalyse erstellt werden, Sie zeigt auf das die beiden Lösungen IS-e / Abacus und SAP S/4 HANA in etwa gleich auf sind.
Für die Entscheidungsfindung wird die Strategische Ausrichtung entscheidend sein 

Aktuell stehen am 28.04.2020 noch Referate durch die zwei SAP Integratoren Avectris und Neo an.
Die Learnings werden anschliessend noch in die Entscheidungsfindung einfliessen.
Die strategische Ausrichtung wird noch durch BIH erarbeitet.> new Text_IT_Board <Das Projekt ERP Evaluation geht in die entscheidende Runde.
Die Nutzwertanalyse konnte im Kernteam nun mehrfauch ausgiebig besprochen werden, was wichtig und nötig war.
Aktuell sind von Seite Kernteam keine Fragen mehr offen.
Auf den Input von Adrian und Gregory wird nun für die Systeme SAP S/4 HANA sowie Abacus / is-e angefragt für eine Demo-Umgebung auf welcher sich definierte Kernteams anhand von Use Cases ein vertieftes Bild der jeweiligen ERP-Lösungen machen können.
> ; ')
