INSERT [dbo].[ProjectsRemarks] ([ID_Remark], [CE_ID_Project], [CreationDate], [LastModifyDate], [Remark]) VALUES (66, 88, CAST(N'2019-12-12T08:54:08.000' AS DateTime), CAST(N'2019-12-12T10:14:13.000' AS DateTime), N'Projekt 88 «Evaluierung Ersatz MFP» wurde im IT-Board angenommen.
Die Lieferantenwahl «Canon » wurde angenommen, die Variante 1 wurde nur bedingt als gut empfunden.
Das IT Board entscheidet sich für einen Kauf der Geräte von Canon, will jedoch zuerst eine Testphase mit einem Gerät durchführen, wird dieser Erfolgreich, können die weiteren 3 MFP’s bestellt werden.
Für die bestehenden Bürodrucker soll mit Itris ein Wartungsvertrag auf Basis der im Vorfeld eingeholten Offerte abgeschlossen werden.
Die Variantenwahl muss nochmals durchdacht werden, das IT Board will in den Büros in denen viel auf den Bürodruckern gedruckt wird die Drucker zwar stark reduzieren aber jeweils ein Gerät stehen lassen.

->Das Projekt 88 «Evaluierung Ersatz MFP» kann geschlossen werden, für die Pilotphase wird ein neues Projekt (#96) eröffnet
')
