INSERT [dbo].[ProjectsRemarks] ([ID_Remark], [CE_ID_Project], [CreationDate], [LastModifyDate], [Remark]) VALUES (97, 96, CAST(N'2020-02-20T08:41:34.000' AS DateTime), CAST(N'2020-02-20T08:41:34.000' AS DateTime), N'Das Testgerät für die Pilotphase wurde am 20.02.2020 angeliefert.
Die Installation für das Testgerät wird am 27.02.2020 stattfinden.
Anschliessend kann das Gerät zum Testen freigegeben werden.
