INSERT [dbo].[ProjectsRemarks] ([ID_Remark], [CE_ID_Project], [CreationDate], [LastModifyDate], [Remark]) VALUES (100, 83, CAST(N'2020-04-20T07:48:47.000' AS DateTime), CAST(N'2020-04-20T07:48:47.000' AS DateTime), N'Alle Fachgruppenworkshops konnten erfolgreich durchgeführt werden
Referenzbesuch bei ewl Luzern war sehr interessant und vermittelte uns einen guten Eindruck über die bei ewl eingesetzte Abacus / IS-e Lösung.
Die Learnings aus den Workshops sowie den Referenz- Besuche / Referate wurden in die (Nutzwert) Analyse einbezogen.

Am letzten Review-Meeting mit AWK konnte die Nutzwertanalyse erstellt werden, Sie zeigt auf das die beiden Lösungen IS-e / Abacus und SAP S/4 HANA in etwa gleich auf sind.
Für die Entscheidungsfindung wird die Strategische Ausrichtung entscheidend sein 

Aktuell stehen am 28.04.2020 noch Referate durch die zwei SAP Integratoren Avectris und Neo an.
Die Learnings werden anschliessend noch in die Entscheidungsfindung einfliessen.
Die strategische Ausrichtung wird noch durch BIH erarbeitet.
')
INSERT [dbo].[ProjectsRemarks] ([ID_Remark], [CE_ID_Project], [CreationDate], [LastModifyDate], [Remark]) VALUES (101, 93, CAST(N'2020-04-20T07:49:15.000' AS DateTime), CAST(N'2020-04-20T07:49:15.000' AS DateTime), N'Installation gemäss Vorgaben (Projektantrag) konnten durch Adfini Sy Group erfolgreich umgesetzt werden.
Das IT Infrastruktur Team hat noch Abklärungen bzw. Feinjustagen hinsichtlich Integration in unser FileSystem zu machen.

Grundsätzlich ist das Projekt gemäss Projektplanung auf Kurs, kam aber durch Corona nun in Verzug und muss um einen Monat verschoben werden.
Nach der Freigabe durch die IT Infrastruktur kann mit dem effektiven Testing mit den Testequipen begonnen werden
Die Testequipen sind klar und konnten bereits angegangen werden.
Folgende Test-Teams sind angedacht:
Seewasserwerk-Projekt Team
Marketing (Martin Kamber, Serge Rau) für Ablösung Trello (Kanban-Board)
Davide Crotta (Engineering) für generelle Abläufe, Projektstrukturen, Filesharing.
')
